/* 
Component - Model Selection Bar in step 2 

--Psuedocode--
MLdropdown Component:
  Props:
    - onModelSelect: Function to handle the selection of ML model
    - trainData: Data imported in step 1 (CSV format converted to a Pandas dataframe)
    - testData: Test data

  State:
    - report: Classification report
    - accuracy: Training accuracy
    - stopTime: Execution time
    - f1_score: F1 score (variation with training data size)

  Function handleOptionSelect(selectedValue):
    If selectedValue is 'logistic_regression':
      Send a POST request to '/logistic-regression' endpoint
      Set report, accuracy, stopTime from the response data
    Else if selectedValue is 'naive_bayes':
      Send a POST request to '/naive-bayes' endpoint
      Set report, accuracy, stopTime from the response data
    Else if selectedValue is 'random_forest':
      Send a POST request to '/random-forest' endpoint
      Set report, accuracy, stopTime from the response data
    Else if selectedValue is 'support_vector_machine':
      Send a POST request to '/support-vector-machine' endpoint
      Set report, accuracy, stopTime from the response data
    Else if selectedValue is 'decision_tree':
      Send a POST request to '/decision-tree' endpoint
      Set report, accuracy, stopTime from the response data

  Render:
    Render a container div
      Render the ML model dropdown with options and handleOptionSelect as the onSelect handler

      If report exists
        Render a classification report div
          Render the report content
            Display the training accuracy
            Display the execution time
            Display the classification report

    Render the component */

import React, { useState } from 'react';
import Dropdown from './GridDropdown';
import axios from 'axios';
import './MLdropdown.css'


const MLdropdown = ({ onModelSelect, trainData, testData }) => {
  const options = [
    { label: 'Logistic Regression', value: 'logistic_regression' },
    { label: 'Naive Bayes', value: 'naive_bayes' },
    { label: 'Random Forest', value: 'random_forest' },
    { label: 'Support Vector Machine', value: 'support_vector_machine' },
    { label: 'Decision Tree', value: 'decision_tree' },
  ];
  const [report, setReport] = useState(null);
  const [accuracy, setAccuracy] = useState(null);
  const [stopTime, setStopTime] = useState(null);
  const [f1_score, setF1Score] = useState(null);


  const handleOptionSelect = async (selectedValue) => {
    console.log('Selected option:', selectedValue);
    onModelSelect(selectedValue);

    if (selectedValue === 'logistic_regression') {
      try {
        const response = await axios.post('/logistic-regression');
        console.log(response.data);
        if (response.data.success) {
          // setF1Score(response.data.graph_url)
          setReport(response.data.report);
          setAccuracy(response.data.accuracy);
          setStopTime(response.data.stop);



        }
      } catch (error) {
        console.error(error);
      }
    }
    else if (selectedValue === 'naive_bayes') {
      try {
        const response = await axios.post('/naive-bayes');
        console.log(response.data);
        if (response.data.success) {
          setReport(response.data.report);
          setAccuracy(response.data.accuracy);
          setStopTime(response.data.stop);
          // setF1Score(response.data.graph_url)

        }
      } catch (error) {
        console.error(error);
      }
    }
    else if (selectedValue === 'random_forest') {
      try {
        const response = await axios.post('/random-forest');
        console.log(response.data);
        if (response.data.success) {
          setReport(response.data.report);
          setAccuracy(response.data.accuracy);
          setStopTime(response.data.stop);
          // setF1Score(response.data.graph_url)
        }
      } catch (error) {
        console.error(error);
      }
    }
    else if (selectedValue === 'support_vector_machine') {
      try {
        const response = await axios.post('/support-vector-machine');
        console.log(response.data);
        if (response.data.success) {
          setReport(response.data.report);
          setAccuracy(response.data.accuracy);
          setStopTime(response.data.stop);
          // setF1Score(response.data.graph_url)
        }
      } catch (error) {
        console.error(error);
      }
    }
    else if (selectedValue === 'decision_tree') {
      try {
        const response = await axios.post('/decision-tree');
        console.log(response.data);
        if (response.data.success) {
          setReport(response.data.report);
          setAccuracy(response.data.accuracy);
          setStopTime(response.data.stop);
          // setF1Score(response.data.graph_url)
        }
      } catch (error) {
        console.error(error);
      }
    }
  };





  return (
    <div>
      <h1>ML Model</h1>
      <Dropdown options={options} onSelect={handleOptionSelect} />

      {report && (
        <div className="classification-report">

          <div className="report-content">

            <pre><u><b>Training Accuracy</b></u>: {accuracy}</pre>
            <pre><u><b>Execution Time</b></u>: {stopTime} seconds</pre>

            <pre><u><b>Classification Report</b></u><br></br><br></br>{report}</pre>

          </div>
        </div>
      )}
    </div>
  );

};

export default MLdropdown;
